import React from "react";
import Hash from './We are hash/hash';
import Marquee from "../../Components/aboutus/marquee/marquee";
import Teams from './Team/Team';
import Service from './explore our services/explore'


const Aboutus = () =>{
    return(
        <>
      
        <Hash />
       <Marquee />
       <Teams />
       <Service />
        </>
    )
}
export default Aboutus;
